import React from 'react';
import { motion } from 'framer-motion';
import { Check, X } from 'lucide-react';

const Features = () => {
  const features = [
    {
      name: "Llamaware",
      features: [
        { text: "Ultra-fast processing", available: true },
        { text: "Advanced AI insights", available: true },
        { text: "Seamless integration", available: true }
      ],
      highlighted: true
    },
    {
      name: "Competitor A",
      features: [
        { text: "Fast processing", available: true },
        { text: "Basic AI recommendations", available: true },
        { text: "Restricts customization", available: false }
      ],
      highlighted: false
    },
    {
      name: "Competitor B",
      features: [
        { text: "Moderate speeds", available: false },
        { text: "No AI assistance", available: false },
        { text: "Steep learning curve", available: false }
      ],
      highlighted: false
    }
  ];

  return (
    <section className="features" id="features">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
        >
          <h2 className="section-title">Features</h2>
          <p className="section-subtitle">
            Compare Llamaware with other solutions and see why developers choose us.
          </p>

          <div className="comparison-table">
            <div className="table-header">
              {features.map((product, index) => (
                <div 
                  key={product.name} 
                  className={`header-cell ${product.highlighted ? 'highlighted' : ''}`}
                >
                  <h3>{product.name}</h3>
                </div>
              ))}
            </div>

            <div className="table-body">
              {features[0].features.map((_, featureIndex) => (
                <div key={featureIndex} className="feature-row">
                  {features.map((product, productIndex) => (
                    <div 
                      key={`${product.name}-${featureIndex}`} 
                      className={`feature-cell ${product.highlighted ? 'highlighted' : ''}`}
                    >
                      <div className="feature-content">
                        <span className="feature-text">
                          {product.features[featureIndex].text}
                        </span>
                        <div className="feature-icon">
                          {product.features[featureIndex].available ? (
                            <Check size={16} color="#38a169" />
                          ) : (
                            <X size={16} color="#e53e3e" />
                          )}
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              ))}
            </div>
          </div>
        </motion.div>
      </div>

      <style jsx>{`
        .features {
          background: #ffffff;
        }

        .comparison-table {
          background: #ffffff;
          border: 1px solid #e2e8f0;
          border-radius: 12px;
          overflow: hidden;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
          margin-top: 60px;
        }

        .table-header {
          display: grid;
          grid-template-columns: repeat(3, 1fr);
          border-bottom: 1px solid #e2e8f0;
        }

        .header-cell {
          padding: 24px;
          text-align: center;
          background: #f7fafc;
          border-right: 1px solid #e2e8f0;
        }

        .header-cell:last-child {
          border-right: none;
        }

        .header-cell.highlighted {
          background: #38a169;
          color: #ffffff;
          border-radius: 8px 8px 0 0;
        }

        .header-cell h3 {
          font-size: 1.125rem;
          font-weight: 600;
          margin: 0;
        }

        .table-body {
          display: flex;
          flex-direction: column;
        }

        .feature-row {
          display: grid;
          grid-template-columns: repeat(3, 1fr);
          border-bottom: 1px solid #e2e8f0;
        }

        .feature-row:last-child {
          border-bottom: none;
        }

        .feature-cell {
          padding: 20px 24px;
          border-right: 1px solid #e2e8f0;
          display: flex;
          align-items: center;
        }

        .feature-cell:last-child {
          border-right: none;
        }

        .feature-cell.highlighted {
          background: rgba(56, 161, 105, 0.05);
        }

        .feature-content {
          display: flex;
          justify-content: space-between;
          align-items: center;
          width: 100%;
        }

        .feature-text {
          font-size: 0.95rem;
          color: #2d3748;
          font-weight: 500;
        }

        .feature-icon {
          display: flex;
          align-items: center;
          justify-content: center;
          width: 24px;
          height: 24px;
        }

        @media (max-width: 768px) {
          .comparison-table {
            margin-top: 40px;
          }

          .header-cell,
          .feature-cell {
            padding: 16px;
          }

          .feature-text {
            font-size: 0.875rem;
          }
        }

        @media (max-width: 480px) {
          .table-header,
          .feature-row {
            grid-template-columns: 1fr;
          }

          .header-cell,
          .feature-cell {
            border-right: none;
            border-bottom: 1px solid #e2e8f0;
          }

          .header-cell:last-child,
          .feature-cell:last-child {
            border-bottom: none;
          }
        }
      `}</style>
    </section>
  );
};

export default Features;
